Type_1.query:
q = load "${App.Datasets.FscDemoActivity.FullyQualifiedName}";
q = filter q by 'ACCOUNTRECORDTYPENAME' != "Household";
q = filter q by date('ACTIVITYDATE_Year', 'ACTIVITYDATE_Month', 'ACTIVITYDATE_Day') in ["current quarter".."current day"];
q = group q by 'TYPE';
q = foreach q generate 'TYPE' as 'Type', count() as 'count';
q = order q by 'Type' asc;
q = limit q 2000;
